import FormularioVendedor from "../components/FormularioVendedor";

export default function Vendedores() {
  return (
    <div className="p-4 max-w-2xl mx-auto">
      <h1 className="text-xl font-bold text-blue-700 mb-4">Alta de Vendedor</h1>
      <FormularioVendedor />
    </div>
  );
}
